import React from "react";
import Home from './components/Home'
import Forum from './components/Forum'
import Placements from './components/Placements'
import Projects from './components/Projects'


function App() {
  return (
    <div className="App">
      <Home />
      <Forum />
      <Placements />
      <Projects />
    </div>
  );
}

export default App;
